let mediaStreamTrack = null; // 视频对象(全局)
let video;
let app = new Vue({
    el: '#app',
    data: {
        material: '',
        originalPosition: '',
        targetPosition: '',
        detailContent: '',
        dataEntity: {}
    },
    mounted: {},
    methods: {
        materialClick: function () {
            // app.material = '342X990EFSFE-334';
            // app.detailContent = '物料扫码<br/>' +
            //     '名称规格：xxxxx  特殊颜色凸显<br/>' +
            //     '单据数量：xx<br/>' +
            //     '操作员 操作时间' + new Date().toLocaleString();
            app.openMedia();
        },
        process:function(){
            app.takePhoto(function (data) {
                app.material =data.data;
            })
        },
        originalClick: function () {
            app.originalPosition = 'O888UUEFSEFE-EEFWEF-WEFWEFEW99999';
            app.detailContent = '原始位置<br/>' +
                '名称规格：xxxxx  特殊颜色凸显<br/>' +
                '单据数量：xx<br/>' +
                '操作员 操作时间' + new Date().toLocaleString();
        },
        targetClick: function () {
            app.targetPosition = 'T9FSEFUFE8FWFE';
            app.detailContent = '目标位置\n' +
                '名称规格：xxxxx  特殊颜色凸显\n' +
                '单据数量：xx\n' +
                '操作员 操作时间' + new Date().toLocaleString();
        },
        clearContent: function () {
            app.material = '';
            app.originalPosition = '';
            app.targetPosition = '';
            app.detailContent = '';

        },
        openMedia: function () {
            let constraints = {
                video: {width: 500, height: 500, facingMode: "environment"},
                audio: false
            };
            //获得video摄像头
            video = document.getElementById('video');
            let promise = navigator.mediaDevices.getUserMedia(constraints);
            promise.then((mediaStream) => {
                // mediaStreamTrack = typeof mediaStream.stop === 'function' ? mediaStream : mediaStream.getTracks()[1];
                mediaStreamTrack = mediaStream.getVideoTracks()
                video.srcObject = mediaStream;
                video.play();
            });
        },
        // 拍照
        takePhoto: function (callback) {
            //获得Canvas对象
            let video = document.getElementById('video');
            let canvas = document.getElementById('canvas');
            let ctx = canvas.getContext('2d');
            ctx.drawImage(video, 0, 0, 500, 500);


            // toDataURL  ---  可传入'image/png'---默认, 'image/jpeg'
            let img = document.getElementById('canvas').toDataURL();
            // 这里的img就是得到的图片
            console.log('img-----', img);
            document.getElementById('imgTag').src = img;
            // img = "data:image/png;base64,";
            app.uploadGetCode(img,callback)
        },
        // 关闭摄像头
        closeMedia: function () {
            let stream = document.getElementById('video').srcObject;
            let tracks = stream.getTracks();

            tracks.forEach(function (track) {
                track.stop();
            });
            document.getElementById('video').srcObject = null;
        },
        uploadGetCode:function (img,callback) {
            $.ajax({
                url:'/api/v1/upload',
                type:"post",
                data:{data:img},
                dataType:"json",
                success:function(data){
                    if(data.code == 200){
                        if (typeof callback === "function") {
                            {
                                callback(data);
                            }
                        }
                    }else{
                        console.log("上传失败");
                    }
                },
                error:function(){
                    console.log("上传失败");
                }
            });
        }

    }

})
//只能输入正整数
numberKeydownFun = function (obj) {
    if (obj.value.length == 1) {
        obj.value = obj.value.replace(/[^1-9]/g, '')
    } else {
        obj.value = obj.value.replace(/\D/g, '')
    }
}

numberKeyupFun = function (obj) {
    if (obj.value.length == 1) {
        obj.value = obj.value.replace(/[^1-9]/g, '')
    } else {
        obj.value = obj.value.replace(/\D/g, '')
    }
}

numberPasteFun = function (obj) {
    if (obj.value.length == 1) {
        obj.value = obj.value.replace(/[^1-9]/g, '');
    } else {
        obj.value = obj.value.replace(/\D/g, '');
    }
}
$("#transferCount").keyup(function () {
    numberKeyupFun(this);
})

$("#transferCount").keydown(function () {
    numberKeydownFun(this);
})

$("#transferCount").bind("paste", function () {
    numberPasteFun(this);
})

